(1, 1, '\"Commencez par séparer le blanc des jaunes d’œufs.\"'),
(2, 1, '\"Dans un saladier, battez de façon vive le sucre en poudre avec les jaunes d’œuf jusqu’à ce que le mélange blanchisse.\"'),
(3, 1, '\"Etape importante : une fois bien mélangé, ajoutez le Mascarpone Galbani. Mélangez-bien jusqu’à obtenir une surface lisse. Réservez le mélange au frais.\"'),
(4, 1, '\"Montez les blancs en neige en les battants vivement à l’aide d’un fouet et incorporez-les délicatement avec une spatule à la préparation mascarpone et jaunes d’œufs réalisée lors de l’étape précédente de l’opération.\\n\\nPour rendre vos blancs en neige bien ferme, ajoutez-y une pincée de sel.\\n\"'),
(5, 1, '\"Déposez la moitié des biscuits imbibés de café fort rapidement et éventuellement une cuillère d’Amaretto, sur le fond d’un plat pour constituer la première couche.\"'),
(6, 1, '\"Recouvrez les biscuits d’une couche de crème au mascarpone avec la moitié de la préparation.\"'),
(7, 1, '\"Disposez une deuxième et dernière couche de biscuits boudoirs imbibés de café.\"'),
(8, 1, '\"Recouvrez avec la dernière couche de crème mascarpone, soit la deuxième moitié de la préparation.\"'),
(9, 1, '\"Placez au réfrigérateur pendant 4 heures minimum (idéalement 24h), le temps qu’il prenne bien au froid.\"'),
(10, 1, '\"Avant de servir, saupoudrez le tiramisu de cacao amer ou de copeaux de chocolat \"'),
(11, 2, '\"Melanger lait et sucre\"'),
(12, 2, '\"ajouter farine\"'),
(13, 2, '\"mettre au four\"'),
(14, 3, '\"Préchauffer le four à 180°C (thermostat 6). Mélanger tout simplement les ingrédients un à un en suivant l\'ordre suivant : levure,\"'),
(15, 3, '\"Ajouter le yaourt\"'),
(16, 3, '\"Ajouter l\'huile\"'),
(17, 3, '\"Ajouter le sucre\"'),
(18, 3, '\"Ajouter la farine\"'),
(19, 3, '\"Ajouter l\'oeuf et le zeste\"'),
(20, 3, '\"Melanger\"'),
(21, 3, '\"Beurrer un moule à manqué et y verser la pâte\"'),
(22, 3, '\"Enfourner pour environ 30 minutes de cuisson.\"'),
(23, 3, '\"Vérifier la cuisson avec la pointe d\'un couteau (elle doit ressortir sèche).\"'),
(24, 4, 'Pelez et coupez les pommes en fines tranches'),
(25, 4, 'Mélangez le sucre, les oeufs, le sucre vanillé'),
(26, 4, 'la crème fraîche'),
(27, 4, 'Etalez la pâte dans un moule à tarte et piquez le fond à l\'aide d\'une fourchette. Disposez les pommes sur la pâte et versez le tout sur les pommes (ou versez uniquement la crème) '),
(28, 4, 'Puis disposer les lamelles de pommes roulées sur ellesmême en roses'),
(29, 4, 'Enfournez environ 30 minutes, jusqu\'à ce que la tarte prenne une belle couleur dorée.'),
(30, 4, 'Déguster'),
(32, 5, 'Couper l\'oignon en petits morceaux et faire revenir dans de l\'huile d\'olive. '),
(33, 5, 'Quand les oignons ont bien bruni, y ajouter les 350g de steak haché. '),
(34, 5, 'Faire cuire à feu moyen puis ajouter la sauce bolognaise.'),
(35, 5, 'Préparez la béchamel. Faire fondre le beurre à feu vif.'),
(36, 5, 'Une fois fondu, rajouter les deux cuillères à soupe de farine puis remuer avec un fouet à feu moyen. '),
(37, 5, 'Quand le mélange est homogène (très rapide), rajouter progressivement le lait sans arrêter de fouetter pour éviter les grumeaux. '),
(38, 5, 'Continuer de remuer jusqu\'à ce que la béchamel s\'épaississe.'),
(39, 5, 'Mélanger la sauce bolognaise faite précédemment avec la béchamel. '),
(40, 5, 'Puis dans un plat à gratin, verser une couche de cette préparation puis recouvrir de pâte à lasagne. Refaire la même chose jusqu\'à épuisement de la sauce (environ 2 fois).'),
(41, 5, 'La dernière couche doit être une couche de sauce. Ajouter le gruyère râpé et faire cuire envrion 45 min à 180° (th.6).'),
